import React from 'https://cdn.jsdelivr.net/npm/react@18.2.0/+esm';
import ReactDOM from 'https://cdn.jsdelivr.net/npm/react-dom@18.2.0/+esm';
import { powerbi } from 'https://cdn.jsdelivr.net/npm/powerbi-client@2.10.0/+esm';

function PowerBIEmbed() {
    const [embedConfig, setEmbedConfig] = React.useState({
        type: 'report',
        embedUrl: "https://app.powerbi.com/reportEmbed?reportId=5c688160-96dd-4819-93ec-a89966b790a1&groupId=191cb1a3-53ef-4907-b67d-0c2e6e27be82",
        id: "5c688160-96dd-4819-93ec-a89966b790a1",
        accessToken: appsmith.store.token,  // assuming you stored token in your Appsmith store.
        tokenType: app.models.tokenType || models.TokenType.Embed
    });

    React.useEffect(() => {
        appsmith.onModelChange((model) => {
            const updatedConfig = {
                ...embedConfig,
                accessToken: model.accessToken || appsmith.store.token
            };
            setEmbedConfig(updatedConfig);
        });

        const container = document.getElementById("powerbi-container");
        powerbi.embed(container, embedConfig);
    }, [embedConfig]);

    return (
        <div id="powerbi-container" style={{width: '100%', height: '100%'}}></div>
    );
}

appsmith.onReady(() => {
    ReactDOM.render(<PowerBIEmbed />, document.getElementById("root"));
});
